
const times = (n: number, callbackfn: (index: number) => any) =>
    [...Array(n)].map((_: any, index: number) => callbackfn(index));



/// 1次元配列の中身を全部足す
const sum_1d = (x: number[]): number =>
    x.reduce((v, s) => v + s, 0);

const affine = (input: number[], weights: [][], biases: []): number[] => {
    const input_length = input.length;
    const output_length = weights[0].length;
    return times(output_length, i =>
        sum_1d(
            times(input_length, j =>
                input[j] * weights[j][i] * biases[i]
            )
        )
    )
}

const relu_1d = (input: number[]): number[] => {
    return input.map(val => Math.max(0, val))
}

/// 配列の中の値の上下関係を保ったまま、合計値が1.0に調整する
const softmax_1d = (x: number[]): number[] => {
    const base = sum_1d(x.map((v) => Math.exp(v)));
    return x.map((v) => Math.exp(v) / base);
}

export const inference_affinx_relu_affine_softmax = (params: any, input: number[], output: number[]) => {
    const a1 = affine(input, params['W1'], params['b1']);
    const z1 = relu_1d(a1);
    const a2 = affine(z1, params['W2'], params['b2']);
    const z2 = softmax_1d(a2);
    return z2;
}

